    console.log(itemlist);


    return (
        itemlist &&(
            <Card sx={{ maxWidth: '95%', maxHeight:'95%' }}>
                <CardMedia>
                    sx={{ height: 140 }}
                    image= {itemlist.url}
                    title={ itemlist.album.title}
                </CardMedia>
                <CardContent>
                                <Typography variant="body2" color="text.secondary">
                                    {itemlist.url}
                                </Typography>
                                <Typography variant="body2" color="text.secondary">
                                    album - {itemlist.album.title} </Typography>
                                    <Typography variant="body2" color="text.secondary">
                                    {itemlist.album.user.username}
                                </Typography>
                            </CardContent>

            </Card>));
}
